import React, { useState } from 'react'
import axios from 'axios';
import NavigationBar from './NavigationBar';

function Registration() {

    const [ptitle, setPTitle] = useState("");
    const [pcity, setPCity] = useState("");
    const [plocation, setPLocation] = useState("");
    const [pprice, setPPrice] = useState("");
    const [pbed, setPBed] = useState("");
    const [pbath, setPBath] = useState("");
    const [parea, setPArea] = useState("");
    const [msg, setMessage] = useState("");

    const onChangeTitle = (e) => setPTitle(e.target.value);
    const onChangeCity = (e) => setPCity(e.target.value);
    const onChangeLocation = (e) => setPLocation(e.target.value);
    const onChangePrice = (e) => setPPrice(e.target.value);
    const onChangeBed = (e) => setPBed(e.target.value);
    const onChangeBath = (e) => setPBath(e.target.value);
    const onChangeArea = (e) => setPArea(e.target.value);

    const handleSubmit = (evt) => {
        evt.preventDefault();
        console.log(`Form submitted:`);
        console.log(`NAME: ${ptitle}`);
        console.log(`EMAIL: ${pcity}`);

        const empinfo = {
            title: ptitle,
            city: pcity,
            location: plocation,
            price: pprice,
            bedroom: pbed,
            bathroom: pbath,
            area: parea,
            
        }

        axios.post('http://localhost:4500/emp/register', empinfo)
            .then(res => {
                console.log(res.data)
                setMessage('REGISTRATION SUCCESSFUL')
            });

        setPTitle('')
        setPCity('')
        setPLocation('')
        setPPrice('')
        setPBed('')
        setPBath('')
        setPArea('')
        setEmpAddress('')

    }

    return (
        <div>
            <NavigationBar />
            <br />
            <h3>REGISTRATION FORM</h3>
            <h4 style={{ color: "brown" }}> {msg}</h4>
            <form onSubmit={handleSubmit}>
                <input type="text" value={ptitle}
                    onChange={onChangeTitle} placeholder="Enter Name"
                    required />
                <br /><br />

                <input type="email" value={pcity}
                    onChange={onChangeCity} placeholder="Enter Email"
                    required />
                <br /><br />

                <input type="number" value={plocation}
                    onChange={onChangeLocation} placeholder="Enter Mobile No"
                    required />
                <br /><br />

                <input type="date" value={pprice}
                    onChange={onChangePrice} />
                <br /><br />

                <input type="password" value={pbed}
                    onChange={onChangeBed} placeholder="Enter Password"
                    required />
                <br /><br />

                <input type="radio" name="gender" value="MALE"
                    checked={pbath === 'MALE'}
                    onChange={onChangeBath} />
                <label>Male</label>

                <input type="radio" name="gender" value="FEMALE"
                    checked={pbath === 'FEMALE'}
                    onChange={onChangeBath} />
                <label>Female</label>
                <br /><br />

                <select value={parea} onChange={onChangeArea}>
                    <option value="AF">Afghanistan</option>
                    <option value="India">India</option>
                    <option value="UK">UK</option>
                    <option value="USA">USA</option>
                </select>
                <br /><br />

               

                <input type="submit" value="REGISTER" className="btn btn-primary" />

            </form>
        </div>
    )
}


export default Registration
